            position: relative;
            width: 42rem;
            height: 28.4rem;
            line-height: 3.2rem;

            @media only screen and (max-width: $bp-tablet) {
                margin: 0 auto;
            }

            @media only screen and (max-width: $bp-mobile) {
                width: 32.2rem;
                margin-left: 2.8rem;
                height: 36.2rem;
                padding: 3.2rem 1.9rem 0.2rem 2.8rem;
                margin-bottom: 2.3rem;
            }

            @media only screen and (max-width: $bp-minimum) {
                width: 28rem;
                margin-left: 2rem;
                height: 40rem;
            }
        }

        &_right {
            font-size: 1.6rem;
            border: 1px solid var(--color-grey);
            padding: 3.4rem 2.8rem 2.6rem 2.8rem;
            position: relative;
            width: 42rem;
            height: 28.4rem;
            line-height: 3.2rem;


            @media only screen and (max-width: $bp-tablet) {
                margin: 0 auto;
            }

            @media only screen and (max-width: $bp-mobile) {
                width: 32.2rem;
                margin-left: 2.8rem;
                height: 36.2rem;
                padding: 3.2rem 1.9rem 0.2rem 2.8rem;
                margin-bottom: 2.3rem;
            }

            @media only screen and (max-width: $bp-minimum) {
                width: 28rem;
                margin-left: 2rem;
                height: 40rem;
            }
        }

        .person {
            display: flex;
            flex-direction: row;
            font-size: 1.6rem;
            margin-top: 3.4rem;

            @media only screen and (max-width: $bp-tablet) {
                width: 76.8rem;
